import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

export default function StatisticsTable(geraeteliste) {
    console.log(geraeteliste);
    return (
        <TableContainer component={Paper}>
            <Table sx={{maxWidth: 1000}} size="medium" aria-label="a dense table">
                <TableHead>
                    <TableRow>
                        <TableCell align="center">Ger√§tenummer</TableCell>
                        <TableCell align="right">Aktueller Verbrauch</TableCell>
                        <TableCell align="right">Durchschnittsverbrauch</TableCell>
                        <TableCell align="right">Maximalverbrauch</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {geraeteliste.geraeteliste.map((row,index) => (
                        <TableRow key={index} sx={{'&:last-child td, &:last-child th': {border: 0}}}>
                            <TableCell align="center" component="th" scope="row">{row.id}</TableCell>
                            <TableCell align="right">{row.messung}</TableCell>
                            <TableCell align="right">{row.durchschnitt}</TableCell>
                            <TableCell align="right">{row.maxverbrauch}</TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    );
}
